import React from "react";

const TodoList = (props) => {
   return (
      <>
         <div className="todo_style">
            <span className="fa fa-times" onClick={()=>{
                props.onSelect()
            }}></span>
            <li>{props.text}</li>
         </div>
      </>
   );
};
export default TodoList;
